drop table   if exists asignatura, paralelo, salas, ofertaAcademica, ofertaAsignatura;
create table salas( aforomax int, tipo text, codsala text primary key);
create table asignatura(ecin text,departamento text,sede text,horasPedagogicas int,creditos int, nombre text, tipoRecurso text, primary key(ecin,departamento));
create table paralelo(correlativo serial primary key, nombre text, cuposMax int, inscritos int, ecin text, materia text, foreign key (ecin,materia) references Asignatura(ecin,departamento), plataforma text, acta text, calificable text, disp text, titular text, semestre text, codSala text, foreign key (codsala) references Salas(codSala)); 
create table ofertaAcademica(semestre text primary key);
create table ofertaAsignatura(semestre text references ofertaAcademica(semestre) ,ecin text,departamento text,foreign key  (ecin,departamento)  references asignatura(ecin,departamento) ,primary key(ecin, departamento,semestre),  cantParalelos int,  demandaEstimada int );


